 (4) присвоение этнической ненависти, этнической дискриминации и подрыва этнического единства;
 (5) подрывает религиозную политику государства и содействия культунам и феодальными суевериями;
 (6) распространение слухов, нарушая социальный порядок и подрывая социальную стабильность;
 (7) распространение непристойности, порнографии, азартные игры, насилие, террор или скопление преступления;
