 (10) действующее во имя незаконной гражданской организации;
 (11) Те, кто не соответствует «промежуточным положениям о разработке и управлении услугами общественных информационных услуг для инструментов обмена мгновенными сообщениями» и соответствует требованиям «семь нижних линий» законов и нормативных актов, социалистической системы, национальные интересы, законные интересы граждан, общественного порядка, социальной морали и информационной подлинности и т. Д.;
 (12) содержание другого контента, запрещенного законами и административными правилами.
