#cfa7a0f О функции управления музыкой #n
-IN онлайн игры, только хост или сервер обладает органами управления управлением операциями управления в музыкальном проигрывателе, таких как пауза, следующая песня, удаление песни и т. Д.;

#cfa7a0f о музыкальном контенте, который можно играть по запросу #N
Соответствуют, только некоторые из песен, уполномоченных QQ Music. В настоящее время мы стремимся к большему количеству разрешений на спрос на песню, поэтому оставаться настроенными;

#cfa7a0f о ограничениях по требованию в онлайн-режиме #N
-Музык, уже в списке «быть в списке» нельзя добавлять неоднократно по требованию;
-Ном домовладельцы могут одновременно добавлять три песни в список ожидания. После достижения верхнего предела они должны ждать, пока песни, которые были приказаны закончить или быть удалены домовладельцем до того, как они смогут заказать их;

#cfa7a0f о режиме воспроизведения музыки #N
-Queue Play: Воспроизведение в порядке игры Play, и песня будет удалена из очереди после его воспроизведения.
Play Play: Воспроизведение в порядке игрового очереди, и песня останется в списке ожидания после игры.

#cfa7a0f о полной функции воспроизведения #n
--Когда включен, все игроки в игре могут добавлять песни в очередь игры.
- Когда закрыто, только хост или сервер в игре могут добавлять песни в очередь воспроизведения.

