- выбрана кнопка справа: когда родительский элемент изменяется, расстояние между ребенком и правой границей родительского элемента не меняется;
Кнопка «upper »выбрана: когда исходные элементы изменения, расстояние между дочерним элементом и верхней границей родительского элемента не меняется;
- Выбрана нижняя кнопка: когда исходные элементы изменения, расстояние между дочерним элементом и нижней границей родительского элемента не меняется;
- В то же время выбираются левые и правые кнопки: когда исходные элементы изменяются, горизонтальное расстояние между дочерним элементом и центральной точкой родительского элемента не меняется;
